pragma solidity ^0.8.0;
interface i1155{
    function gflame(string memory flame_) external pure returns(address);
    function getbag(uint256 nftea_, address holder_) external pure returns(string memory, address, uint256[] memory, bool);
    function _ipfs(uint256) external pure returns(string memory);
    function _nftea2wallet(uint256) external pure returns(address);
    function getContract(address contract_) external returns(bool);
    function _holders(uint256 nftea_) external returns(address[] memory);
    function loveLock(address wallet_) external returns(bool);
    function getadmin(address admin_) external pure returns(bool);
}
contract teapot {
  using SafeMath for uint256;

    struct LOAN {
        uint256 nftea;
        uint256 collateralAmount; // Amount of collateral (BNB + Tea Tokens)
        uint256 unlockDate; // Unlock date of the NFT's wallet
        address asset; //address of token to borrow
        bool isDefaulted; // Flag indicating if the loan is defaulted
        bool active; //is collateral active
        address holder; // Address of the NFT holder
    }

    string public name = "TEAPOT V1";
    uint256 public loanID;
    mapping(uint256 => LOAN) private loans;
    mapping(uint256 => uint256) private nft2loan;
    // Tea Pot balance
    uint256 private bnbBalance;
    uint256 private teaTokenBalance;

    // Loan to value parameters
    uint256 private constant initialLoanToValue = 45; // Initial loan to value (45%)
    uint256 private constant loanToValueIncrement = 3; // Increment for successful loan repayment
    uint256 private constant maxLoanToValue = 85; // Maximum loan to value (85%)
    uint256 public love = 10000000*10**9; // Love Rewards
    uint256 public walletmin = 100000000*10**9; // minimum wallet balance

    // Loan default parameters
    uint256 private constant defaultServiceFee = 5; // Service fee for buying defaulted assets (5%)
    mapping(address=>uint256) public user2LTV; // user loan to value
    mapping(address=>uint256) public tokenBalance; //teapot token balance
    mapping(address=>uint256) public user2lastloan;
    mapping(address=>uint256[]) public user2loans;
    mapping(address=>mapping(uint256=>uint256)) public user2loansx;

    uint256[] public activeLoans;
    mapping(uint256=>uint256) public activeLoansx;
    mapping(address=>bool) public isAdmin;
    mapping(address=>mapping(uint256=>bool)) public loveshown;
    mapping(address=>uint256) public user2GasRefundOwned;
    mapping(uint256=>uint256) public displayEarnings;
    address public wallet = payable(0xDEa2BD4f31fC22892C42965d92d6FadAe4EDc75A);
    address public _fire;

    // Events
    event LoanIssued(uint256 nftea, uint256 loanAmount, address member, uint256 brewdate);
    event LoanRepaid(uint256 loan, uint256 nftea, uint256 repayAmount);
    event AssetBought(uint256 loan, uint256 nftea, uint256 purchaseAmount);
    event LoveShown(uint256 nftea, address member, uint256 value);
    event GasRefunded(address holder, uint256 value);
    event GasRefund(address holder, uint256 value);

    constructor(address fire_){
        _fire = fire_;
        loanID = 0;
        isAdmin[msg.sender] = true;
    }
    receive () external payable {}
    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function setWallet(address wallet_) public{

      (bool success) = i1155(_fire).getadmin(msg.sender);
      require(success, 'not an admin teapot 1');
      wallet = payable(wallet_);

    }
    function setGasRefund(address holder_, uint256 gas_) public returns(bool){

      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not valid caller');
      user2GasRefundOwned[holder_] += gas_;
      emit GasRefund(holder_,gas_);
      return true;

    }
    function setLove(uint256 love_, uint256 walletmin_) public{

      (bool success) = i1155(_fire).getadmin(msg.sender);
      require(success, 'not an admin teapot 3');
      if(love_>0){
        love = love_ * 10**9;
      }
      if(walletmin_>0){
        walletmin = walletmin_ * 10**9;
      }
    }
    function gasRefund() external{

      require(user2GasRefundOwned[msg.sender]>0, 'no gas refund');
      require(address(this).balance >= user2GasRefundOwned[msg.sender], 'low teapot balance' );
      address payable recipient = payable(msg.sender);
      recipient.transfer(user2GasRefundOwned[msg.sender]);
      emit GasRefunded(msg.sender,user2GasRefundOwned[msg.sender]);
      user2GasRefundOwned[msg.sender] = 0;

    }
    function showLove(uint256 nftea_, address holder_) external{

      require(!loveshown[msg.sender][nftea_], 'you already showed love');
      (address tea_) = i1155(_fire).gflame('teatoken');
      uint256 balance_ = IERC20(tea_).balanceOf(msg.sender);
      require(balance_ >= walletmin, 'your tea balance is too low to show love');
      (address flame_) = i1155(_fire).gflame('mintcontract');
      (,address bag_,,) = i1155(flame_).getbag(nftea_,holder_);
      uint256 bagbalance_ = IERC20(tea_).balanceOf(bag_);
      require(bagbalance_>love, 'love your work 1st');
      uint256 lovebonus_ = 0;
      if(user2LTV[msg.sender]>0){
        lovebonus_ = love.mul(user2LTV[msg.sender]).div(100);
      }
      (bool success) = IERC20(tea_).transfer(bag_, love.add(lovebonus_));
      require(success, 'error showing love');
      (flame_) = i1155(_fire).gflame('baglogic');
      (success) = i1155(flame_).loveLock(bag_);
      require(success, 'love locking wallet');
      loveshown[msg.sender][nftea_] = true;
      displayEarnings[nftea_] += love.add(lovebonus_);
      emit LoveShown(nftea_, msg.sender, love.add(lovebonus_));
    }
    function issueLoan(uint256 nftea_, address token_, bool bnbonly_) external {
        require(nft2loan[nftea_]==0, 'loan active for nftea');
        loanID = loanID + 1;
        LOAN storage loan = loans[loanID];
        uint256 balance_;
        uint256 bagbalance_;
        (address flame_) = i1155(_fire).gflame('mintcontract');
        (,address bag_,uint256[] memory numbers,) = i1155(flame_).getbag(nftea_,msg.sender);
        require(numbers[2]>0, 'you do not own this nfea');
        if(loans[user2lastloan[msg.sender]].isDefaulted && user2LTV[msg.sender] > 15){
          user2LTV[msg.sender] = user2LTV[msg.sender].sub(15);
        }
        uint256 ltv_ = user2LTV[msg.sender];
        if(ltv_==0){
          ltv_ = initialLoanToValue;
        }
        if(bnbonly_){

            balance_ = address(this).balance;
            bagbalance_ = bag_.balance;

        }else{

          balance_ = IERC20(token_).balanceOf(address(this));
          bagbalance_ = IERC20(token_).balanceOf(bag_);

        }
        uint256 loanAmount = bagbalance_.mul(ltv_).div(100);
        require(balance_ >= loanAmount, "tea pot balance lower than requested amount");
        IERC1155(flame_).safeTransferFrom(msg.sender,address(this),nftea_, 1,'');
        require(checkSuccess(), 'sale transfer failed');
        if(bnbonly_){
          // Transfer loan amount from Tea Pot to the user
          address payable recipient = payable(msg.sender);
          recipient.transfer(loanAmount);
          loan.asset = address(0);
        }else{

          (bool success) = IERC20(token_).transfer(msg.sender, loanAmount);
          require(success, 'error loaning token');
          loan.asset = token_;
        }
        loan.nftea = nftea_;
        loan.collateralAmount = loanAmount;
        loan.active = true;
        loan.holder = msg.sender;
        loan.isDefaulted = false;
        loan.unlockDate = block.timestamp + 1 * 30 days;
        user2loans[msg.sender].push(loanID);
        user2loansx[msg.sender][loanID] = user2loans[msg.sender].length - 1;
        activeLoans.push(loanID);
        activeLoansx[loanID] = activeLoans.length - 1;
        nft2loan[nftea_] = loanID;
        user2LTV[msg.sender] = ltv_;
        emit LoanIssued(nftea_, loanAmount, msg.sender, block.timestamp + 1 * 30 days);
    }

    function repayLoan(uint256 nftea_) public payable {

        LOAN storage loan = loans[nft2loan[nftea_]];
        require(loan.unlockDate > block.timestamp, "Loan is defaulted");
        (address flame_) = i1155(_fire).gflame('mintcontract');
        if(loan.asset==address(0)){
          require(msg.value== loan.collateralAmount, 'insufficient amount');
          (bool success,) = address(this).call{value: msg.value}("");
          require(success, "Tea Pot: Error repaying loan");

        }else{

          IERC20(loan.asset).transferFrom(msg.sender,address(this),loan.collateralAmount);
          require(checkSuccess(), 'eror paying');

        }
        IERC1155(flame_).safeTransferFrom(address(this),msg.sender,loan.nftea, 1,'');
        loan.active = false;
        activeLoans[activeLoansx[nft2loan[nftea_]]] = activeLoans[activeLoans.length - 1];
        activeLoans.pop();
        user2loans[msg.sender][user2loansx[msg.sender][nft2loan[nftea_]]] = user2loans[msg.sender].length - 1;
        user2loans[msg.sender].pop();

        if(user2LTV[msg.sender]<90){
          user2LTV[msg.sender] += loanToValueIncrement;
        }
        nft2loan[loan.nftea] = 0;
        emit LoanRepaid(nft2loan[nftea_], loan.nftea, loan.collateralAmount);
    }

